export default function Card(props) {
   return (
      <div style={{
            backgroundColor: 'red',
            margin:'5',
            width: '200',
            position: 'flex',
            justifyContent: 'center',
         }}>
         <button onClick={props.onClose}>X</button>
         <img src={props.image} alt='' 
            width= {'100'} 
            height={'100'} 
         />
         <h2>{props.name}</h2>
         <h2>{props.species}</h2>
         <h2>{props.gender}</h2>
         <h2>{props.origin}</h2>
      </div>
   );
}
